import{_ as e,o as t,c as a,O as r}from"./chunks/framework.9482e208.js";const m=JSON.parse('{"title":"§ 33.2-1511 Definitions.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/33.2-1511.md","filePath":"vacode/33.2-1511.md"}'),i={name:"vacode/33.2-1511.md"},n=r('<h1 id="§-33-2-1511-definitions" tabindex="-1">§ 33.2-1511 Definitions. <a class="header-anchor" href="#§-33-2-1511-definitions" aria-label="Permalink to &quot;§ 33.2-1511 Definitions.&quot;">​</a></h1><p>As used in this article, unless the context requires a different meaning:</p><p>&quot;Federal highway reimbursements&quot; means all federal-aid highway construction reimbursements and any other federal highway assistance received from time to time by the Commonwealth under or in accordance with Title 23 of the United States Code or any successor program established under federal law from the Federal Highway Administration and any successor or additional federal agencies.</p><p>&quot;GARVEE,&quot; a grant anticipation revenue vehicle, means an &quot;eligible debt financing instrument&quot; as defined under 23 U.S.C. § 122, the principal of and interest on which and certain other costs associated therewith may be reimbursed by federal highway reimbursements.</p><p>&quot;Notes&quot; means those notes authorized and issued pursuant to § <a href="http://law.lis.virginia.gov/vacode/33.2-1512/" target="_blank" rel="noreferrer">33.2-1512</a>.</p><p>&quot;Project-specific reimbursements&quot; means the federal highway reimbursements received by the Commonwealth only with respect to the project or projects to be financed by the Notes or any series thereof.</p><p>&quot;Series&quot; means any grouping of Notes issued as designated as such by the Board as necessary or desirable for administrative convenience, satisfaction of federal tax or securities law requirements, or any similar purpose.</p><p>2011, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?111+ful+CHAP0830" target="_blank" rel="noreferrer">830</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?111+ful+CHAP0868" target="_blank" rel="noreferrer">868</a>, § 33.1-23.14; 2014, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?141+ful+CHAP0805" target="_blank" rel="noreferrer">805</a>.</p>',8),o=[n];function s(c,d,l,h,u,f){return t(),a("div",null,o)}const g=e(i,[["render",s]]);export{m as __pageData,g as default};
